/* ==UserStyle==
@name           portalacademico.eniac.edu.br - 24/08/2023, 21:34:01
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */
@-moz-document url-prefix("https://portalacademico.eniac.edu.br/") {
    .autocompletion {}

    .autocompletion:before {
        color: #88C34A;
        content: "●";
        font-size: 60px;
        position: absolute;
        top: -38px;
        right: -8px;
    }

    .autocompletion:after {
        position: absolute;
        top: 2px;
        right: 4px;
        font-size: 18px;
        color: white;
        content: "✓"
    }

    .outoftotal:before {
        color: #88C34A;
        content: "●";
        font-size: 60px;
        position: absolute;
        top: 309px;
        left: 20px;
    }

    .outoftotal:after {
        position: absolute;
        top: 335px;
        left: 31px;
        font-size: 18px;
        color: #fff;
        content: "✓"
    }

    .snap-course-dashboard:before {
        color: #88C34A;
        content: "●";
        font-size: 60px;
        position: absolute;
        top: 443px;
        left: 20px;
    }

    .snap-course-dashboard:after {
        position: absolute;
        top: 480px;
        left: 31px;
        font-size: 18px;
        color: #fff;
        content: "✓"
    }

    .snap-section-complete {
        opacity: 1;
    }

    .icon {
        opacity: 0;
    }
}
